import FacultyRegister from './Components/FacultyRegister'; 
import SecurityRegister from './Components/SecurityRegister'; 

import StudentLogin from './Components/StudentLogin.js';
import FacultyLogin from './Components/FacultyLogin.js';
import SecurityLogin from './Components/SecurityLogin.js';

import StudentPage from './Components/StudentPage.js';
import FacultyPage from './Components/FacultyPage.js';
import SecurityPage from './Components/SecurityPage.js';
import './App.css';

function App() {
  return (
    <>
      <Router>
        <Routes>
          <Route Component={Home} path='/'/>
